import './Decor.css';

import { Container } from "react-bootstrap";

function Decor(){
    return(
        <div>
            <Container fluid>
                <div className = "decor">

                    <div className = "decor__content">

                    </div>

                    <div className = "decor_image">
                        <img src = {Decor} className = "w-100"/>
                    </div>

                </div>
            </Container>
        </div>
    )
}

export default Decor
